    {
      "date": null,
      "tags_section": null,
      "text": "36. Bey Hrn. Nudolf Ramfperger an der Huth, gaf ift extra guter Hollander-Taback in bleyer\nnen Pfund Buchsen à 10 Baßen, wie auch\ngater St. Vincent à 8 Biz. zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "7. Wo guter Art grosse Bohnen zum Sehen,\nund kleine weisse dito zum Kochen in billigem\nPreis zu haben, ist im Berichthaus ohne Ent\ngeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "18. Zwey Baretlein oder Professor Hüth,wie auch\nein ganz neuer Castor Huth, mittelmäßiger\nGrosse, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "19. Bey Hrn. Burkhardt zum Riesen sind extra\nneue grosse Italianische Feigen, dito grosse\nMeertrauben mit und ohne Stiel, Haselnus,\ndurre Morcheln, feiner Chocoladen, alles in\nbilligem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "20. Zwölf Såck neuer Waizen in billigem Preis,\nim Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "21. Bey Hrn. Jacob F Grimon Buchbinder ist zu\nhaben: Ein Kriegs-Atlas von 65 theils Land\nKarten, Städten, Plans von Bataillen und\nBelagerungen des jezigen Kriegs. 2) Die\nWelt in einer Nuß mit Kupfern. 3) Die\nDurchlauchtige Welt, 4 Theil mit Waapen.\n4) Journal du Camp de Compiegne avec fi\ngures."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "22. Zwey saubere französische Bether in ein Wirths:\nHaus auf das Land oder in ein Bad dienlich,\nohnentgeltlich im Berichthars zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "23. Eine Bchaufung in der Aeschemer Vorstadt\nmit 4 Stuben, Kamnern samt einer grof\nfen Werkstatt, Estrig und einem schönen ges\nwölbten Keller und Garten, weshalb sich bey\nHrn. Jacob Maglin dem Weinmann anzus\nmelden."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "24. Ein Freund, welcher circa 600 Sester Hanf\nSaamen anhero liefern könnte, mochte aber\nfolchen vorhero verkauft wissen, offeriet felbis\ngen dahero in bilirgem Preis, im Berichthaus\nzu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "25. Wo guter alter weisser Wein zu haben, ist\nbey Mitr. Michael Fuchs dem Kiefer zu ver\nnehmen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "26. Circa 6. Saut extra guter alter pur rother\nJosteiner Wein, so gut als Neuenburger oder\nBurgunder, in billigem Preis, im Bericht\nhaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "27. Zwey Stücklein weissen Wein von 1960.\n8 Pfund 10 sf der Saum im einten, und à\n8 Pfund im andern, wovon nach Belieben zu\nhaben, im Berichthaus ohne Entgeldt zu ers\nfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "28. Ein Stock Heu ab z Thanen Matten vorm\nRiechener Thor oberhalb der Schorenbruck.\nFerner ein Stücktein von 17 Sammen rothen\nBölliger Wein von 1760. schon roth und laus\nter, im Berichthaus ohne Entgeldt zu erfra\ngen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "29. Auf E. E. Zunft zum Båren sind wiederum\nneue Saure Ruben in billigem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "30. Ein roth Scharlachen Camisol und Hosen in\nbilligem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "31. Im Offenburger Hof ist wohlverwährter\nBau zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "32. Ein Brennhauslein bey der Steinen Mühlin\nmit aller aller Kommlichkeit, im Berichthaus ohne\nEntgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "33. Bey weme rother und weisser Burgunder ,\nwie auch Muscat Wein, Piecenweis wegen\nMangel Mazes, wie auch roth und weisser\n1753ger Margráfer Bein in billigem Preis zur\nhaben, ist im Berichthaus ohne Entgeldt zu\nerfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "34. Feine heitergelbe Hamburger Strick Wollen\ndas Pfund à 6 Pfund, wo dieselbe Pfundweis\nzu haben, ist im Berichthaus ohne Entgeldt zus\nerfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "31. Herrn Holzach des Siegrists Behausung ins\nSpiegelgåßlein mit 4 Stuben, 3 Kaninern c.\nist entweder zu verkaufen, oder famethaft zus\nverleihen,"
    },
    {
      "date": null,
      "tags_section": null,
      "text": "36. Weisse umd rothe Margråfer Weine von\n1760. wovon in billigem Preis nach Belieben\nzu haben, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "37. Ein Mannensitz in St. Peters Kirch auf dens\nLetner. Item ein grún Tombeau Bethlein\nmit grünen wollenen Umhängen, in billigem\nPreis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "38. Ein Hausschlitten mit einem schönen Bild\nund Zugehördt in billigem Preis, im Berichts\nhaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "39. Der Bårenfelser Hof zu St. Peter, mit\nGarten, Stallung, Keller sc. wie der Augens\nschein zeigen wird. In Ermanglung eines\nKaufers"
    }
  ]
}

